import React from 'react'
import CurrentList from './CurrentList'
import { inject,observer } from 'mobx-react';
import './index.less'

@inject('WorkStore')
@observer
class ListPage extends React.Component{
	render(){
		return <div>
			<CurrentList />
		</div>
  }
}

export default ListPage
